=Please, deeply analyse topic - {{ $('Set Query').item.json.query }}.
Provide list of opportunities, rising topics and regions, 3 ideas for getting value from this trend based on analysis.
Keep it short and valuable, follow 80/20 rule.

IMPORTANT DONT Use markdown.
IMPORTANT Use simple language.

Interest (timestamp - value):{{ $('Set Interest').item.json.interest.map(item => `${item.date} - ${item.value}`).join('\n') }}

Interest by region:{{ $('Set Interest by Region').item.json.interest_region.map(item => `${item.country} - ${item.value}`).join('\n') }}

Topics:{{ $('Set Topics Web').item.json.topics.slice(0,5).map(item => `${item.topic} - ${item.score}`).join('\n') }}

Queries: {{ $('Set Queries Web').item.json.queries_web.slice(0,10).map(item => `${item.query} - ${item.value}`).join('\n') }}

