=<!DOCTYPE html>
<html>
<head>
    <title>Report Dashboard</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body { 
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
            background: #f5f5f7;
            color: #1d1d1f;
            line-height: 1.6;
        }

        .container { 
            max-width: 1200px; 
            margin: 0 auto; 
            padding: 40px 20px;
        }

        h1 {
            font-size: 48px;
            font-weight: 700;
            text-align: center;
            margin-bottom: 60px;
            color: #1d1d1f;
            letter-spacing: -0.02em;
        }

        .section {
            background: white;
            border-radius: 16px;
            margin-bottom: 32px;
            padding: 32px;
            box-shadow: 0 4px 20px rgba(0, 0, 0, 0.05);
            border: 1px solid rgba(0, 0, 0, 0.04);
        }

        .section h2 {
            font-size: 24px;
            font-weight: 600;
            margin-bottom: 24px;
            color: #1d1d1f;
            letter-spacing: -0.01em;
        }

        .chart-container {
            height: 300px;
            margin: 24px 0;
        }

        .grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
            gap: 24px;
        }

        .table-container {
            overflow-x: auto;
        }

        table {
            width: 100%;
            border-collapse: collapse;
            font-size: 14px;
        }

        th {
            text-align: left;
            padding: 12px 0;
            border-bottom: 1px solid #e5e5e7;
            font-weight: 500;
            color: #6e6e73;
            text-transform: uppercase;
            font-size: 11px;
            letter-spacing: 0.5px;
        }

        td {
            padding: 16px 0;
            border-bottom: 1px solid #f5f5f7;
            font-weight: 400;
        }

        tr:last-child td {
            border-bottom: none;
        }

        .card {
            background: white;
            border-radius: 12px;
            padding: 24px;
            margin-bottom: 16px;
            border: 1px solid rgba(0, 0, 0, 0.04);
            transition: all 0.2s ease;
        }

        .card:hover {
            transform: translateY(-2px);
            box-shadow: 0 8px 30px rgba(0, 0, 0, 0.12);
        }

        .card-title {
            font-size: 16px;
            font-weight: 600;
            margin-bottom: 8px;
            color: #1d1d1f;
            line-height: 1.3;
        }

        .card-snippet {
            font-size: 14px;
            color: #6e6e73;
            margin-bottom: 12px;
            line-height: 1.4;
        }

        .card-link {
            color: #007aff;
            text-decoration: none;
            font-size: 14px;
            font-weight: 500;
        }

        .card-link:hover {
            text-decoration: underline;
        }

        .video-card {
            display: flex;
            align-items: flex-start;
            gap: 16px;
            background: white;
            border-radius: 12px;
            padding: 20px;
            margin-bottom: 12px;
            border: 1px solid rgba(0, 0, 0, 0.04);
            transition: all 0.2s ease;
        }

        .video-card:hover {
            transform: translateY(-1px);
            box-shadow: 0 4px 20px rgba(0, 0, 0, 0.08);
        }

        .video-thumbnail {
            width: 120px;
            height: 68px;
            background: #f5f5f7;
            border-radius: 8px;
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 12px;
            color: #6e6e73;
            font-weight: 500;
            flex-shrink: 0;
        }
.video-thumbnail img {
    width: 100%;
    height: 100%;
    object-fit: cover;
    border-radius: 8px;
}

        .video-info {
            flex: 1;
        }

        .video-title {
            font-size: 16px;
            font-weight: 600;
            margin-bottom: 6px;
            color: #1d1d1f;
            line-height: 1.3;
        }

        .video-channel {
            font-size: 14px;
            color: #6e6e73;
            margin-bottom: 4px;
        }

        .video-duration {
            font-size: 12px;
            color: #86868b;
        }

        .country-item {
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 12px 0;
            border-bottom: 1px solid #f5f5f7;
        }

        .country-item:last-child {
            border-bottom: none;
        }

        .country-name {
            font-size: 16px;
            font-weight: 500;
            color: #1d1d1f;
        }

        .country-value {
            font-size: 16px;
            font-weight: 600;
            color: #007aff;
        }

        .tabs {
            display: flex;
            background: #f5f5f7;
            border-radius: 10px;
            padding: 2px;
            margin-bottom: 24px;
        }

        .tab {
            flex: 1;
            padding: 10px 16px;
            text-align: center;
            border-radius: 8px;
            cursor: pointer;
            font-size: 14px;
            font-weight: 500;
            color: #6e6e73;
            transition: all 0.2s ease;
        }

        .tab.active {
            background: white;
            color: #1d1d1f;
            box-shadow: 0 2px 8px rgba(0, 0, 0, 0.08);
        }

        .tab-content {
            display: none;
        }

        .tab-content.active {
            display: block;
        }

        .map-container {
            height: 300px;
            background: #f5f5f7;
            border-radius: 12px;
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 14px;
            color: #6e6e73;
        }

        .value-badge {
            background: #007aff;
            color: white;
            padding: 4px 12px;
            border-radius: 20px;
            font-size: 12px;
            font-weight: 600;
        }

        .metric-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 16px;
            margin-bottom: 24px;
        }

        .metric-card {
            background: white;
            border-radius: 12px;
            padding: 24px;
            text-align: center;
            border: 1px solid rgba(0, 0, 0, 0.04);
        }

        .metric-value {
            font-size: 32px;
            font-weight: 700;
            color: #1d1d1f;
            margin-bottom: 8px;
        }

        .metric-label {
            font-size: 14px;
            color: #6e6e73;
            font-weight: 500;
        }
    </style>
    <script src="https://cdn.jsdelivr.net/npm/chart.js"></script>
</head>
<body>
    <div class="container">
        <h1>Analytics Report</h1>

        <!-- AI Analysis -->
        <div class="section">
            <h2>AI Analysis of {{$('Webhook').item.json.query.query}}</h2>
            <p id="aiAnalysisText"></p>
        </div>

        <!-- Interest Over Time -->
        <div class="section">
            <h2>Interest Over Time</h2>
            <div class="chart-container">
                <canvas id="interestChart"></canvas>
            </div>
        </div>

        <!-- Interest by Country -->
        <div class="section">
            <h2>Interest by Country</h2>
            <div class="tabs">
                <div class="tab active" onclick="switchTab('table')">Table</div>
                <div class="tab" onclick="switchTab('map')">Map</div>
            </div>

            <div id="countryTable" class="tab-content active">
                <div id="countryList"></div>
            </div>

            <div id="countryMap" class="tab-content">
                <div class="map-container">
                    World map visualization
                </div>
            </div>
        </div>

        <!-- Web vs YouTube Queries -->
        <div class="section">
            <h2>Query Performance</h2>
            <div class="grid">
                <div>
                    <h3 style="font-size: 18px; font-weight: 600; margin-bottom: 16px; color: #1d1d1f;">Web Queries</h3>
                    <div class="table-container">
                        <table id="webTable">
                            <thead>
                                <tr>
                                    <th>Query</th>
                                    <th>Volume</th>
                                </tr>
                            </thead>
                            <tbody id="webTableBody"></tbody>
                        </table>
                    </div>
                </div>
                <div>
                    <h3 style="font-size: 18px; font-weight: 600; margin-bottom: 16px; color: #1d1d1f;">Rising Queries</h3>
                    <div class="table-container">
                        <table id="youtubeTable">
                            <thead>
                                <tr>
                                    <th>Query</th>
                                    <th>Volume</th>
                                </tr>
                            </thead>
                            <tbody id="youtubeTableBody"></tbody>
                        </table>
                    </div>
                </div>
            </div>
        </div>

        <!-- Topics -->
        <div class="section">
            <h2>Top Topics</h2>
            <div class="table-container">
                <table>
                    <thead>
                        <tr>
                            <th>Topic</th>
                            <th>Score</th>
                        </tr>
                    </thead>
                    <tbody id="topicsTableBody"></tbody>
                </table>
            </div>
        </div>

        <!-- Search Results -->
        <div class="section">
            <h2>Search Results</h2>
            <div id="searchResults"></div>
        </div>

        <!-- Video Results -->
        <div class="section">
            <h2>Video Results</h2>
            <div id="videoResults"></div>
        </div>
    </div>

    <script>
        // Dynamic Variables
        const aiAnalysis = {{
  JSON.stringify($json.output)
 }};

        const interestData = {{  
  JSON.stringify(Object.assign({}, ...$('Aggregate').item.json.data).interest)
 }};

        const countryData = {{  
  JSON.stringify(Object.assign({}, ...$('Aggregate').item.json.data).interest_region)
 }};

        const webQueries = {{  
  JSON.stringify(Object.assign({}, ...$('Aggregate').item.json.data).queries_web)
 }};

        const youtubeQueries = {{  
  JSON.stringify(Object.assign({}, ...$('Aggregate').item.json.data).rising_web)
 }};

        const topicsData = {{  
  JSON.stringify(Object.assign({}, ...$('Aggregate').item.json.data).topics)
 }};

        const searchResults = {{  
  JSON.stringify(Object.assign({}, ...$('Aggregate').item.json.data).search)
 }};

        const videoResults = {{  
  JSON.stringify(Object.assign({}, ...$('Aggregate').item.json.data).youtube)
 }};
        // Initialize everything
        document.addEventListener('DOMContentLoaded', function() {
            // Inject AI Analysis text
            document.getElementById('aiAnalysisText').innerText = aiAnalysis;

            initializeChart();
            renderCountryData();
            renderQueryTables();
            renderTopicsTable();
            renderSearchResults();
            renderVideoResults();
        });

        function initializeChart() {
            const ctx = document.getElementById('interestChart').getContext('2d');
            new Chart(ctx, {
                type: 'line',
                data: {
                    labels: interestData.map(item => 
  new Date(item.date * 1000).toLocaleDateString('en-US', { month: 'short', day: 'numeric' })
),
                    datasets: [{
                        label: 'Interest Score',
                        data: interestData.map(item => item.value),
                        borderColor: '#007aff',
                        backgroundColor: 'rgba(0, 122, 255, 0.1)',
                        borderWidth: 2,
                        fill: true,
                        tension: 0.4,
                        pointRadius: 4,
                        pointHoverRadius: 6,
                        pointBackgroundColor: '#007aff',
                        pointBorderColor: '#ffffff',
                        pointBorderWidth: 2
                    }]
                },
                options: {
                    responsive: true,
                    maintainAspectRatio: false,
                    plugins: {
                        legend: {
                            display: false
                        }
                    },
                    scales: {
                        y: {
                            beginAtZero: true,
                            max: 100,
                            grid: {
                                color: '#f5f5f7'
                            },
                            ticks: {
                                color: '#6e6e73',
                                font: {
                                    size: 12
                                }
                            }
                        },
                        x: {
                            grid: {
                                display: false
                            },
                            ticks: {
                                color: '#6e6e73',
                                font: {
                                    size: 12
                                }
                            }
                        }
                    }
                }
            });
        }

        function renderCountryData() {
            const container = document.getElementById('countryList');
            container.innerHTML = countryData.map(item => `
                <div class="country-item">
                    <span class="country-name">${item.country}</span>
                    <span class="country-value">${item.value}</span>
                </div>
            `).join('');
        }

        function renderQueryTables() {
            const webTableBody = document.getElementById('webTableBody');
            webTableBody.innerHTML = webQueries.map(item => `
                <tr>
                    <td>${item.query}</td>
                    <td><span class="value-badge">${item.value.toLocaleString()}</span></td>
                </tr>
            `).join('');

            const youtubeTableBody = document.getElementById('youtubeTableBody');
            youtubeTableBody.innerHTML = youtubeQueries.map(item => `
                <tr>
                    <td>${item.query}</td>
                    <td><span class="value-badge">${item.value.toLocaleString()}</span></td>
                </tr>
            `).join('');
        }

        function renderTopicsTable() {
            const tableBody = document.getElementById('topicsTableBody');
            tableBody.innerHTML = topicsData.map(item => `
                <tr>
                    <td>${item.topic}</td>
                    <td><span class="value-badge">${item.score}</span></td>
                </tr>
            `).join('');
        }

        function renderSearchResults() {
            const container = document.getElementById('searchResults');
            container.innerHTML = searchResults.map(item => `
                <div class="card"><a href="${item.link}" class="card-link" target="_blank">
                    <div class="card-title">${item.title}</div>
                    <div class="card-snippet">${item.snippet}</div>
                    </a>
                </div>
            `).join('');
        }

        function renderVideoResults() {
            const container = document.getElementById('videoResults');
            container.innerHTML = videoResults.map(item => `
                <div class="video-card"> <a href="${item.link}" class="card-link" target="_blank">
                    <div class="video-thumbnail"><img src="https://img.youtube.com/vi/${item.link.match(/[?&]v=([^&]+)/)?.[1]}/default.jpg"></div>
                    <div class="video-info">
                        <div class="video-title">${item.title}</div>
                        <div class="video-channel">${item.channel}</div>
                        <div class="video-duration">${item.duration}</div>
                    </div>
                   </a>
                </div>
            `).join('');
        }

        function switchTab(tab) {
            document.querySelectorAll('.tab').forEach(t => t.classList.remove('active'));
            document.querySelectorAll('.tab-content').forEach(t => t.classList.remove('active'));

            event.target.classList.add('active');
            document.getElementById(tab === 'table' ? 'countryTable' : 'countryMap').classList.add('active');
        }
    </script>
</body>
</html>
